APP_ICON_BASE64 = ""

import sys
import os
import base64
import math
import json
from PyQt6.QtWidgets import QWidget, QApplication, QVBoxLayout
from PyQt6.QtGui import QPixmap, QPainter, QColor, QImage, qGray, QPainterPath
from PyQt6.QtCore import (
    Qt, QPropertyAnimation, pyqtProperty, QEasingCurve, QSequentialAnimationGroup,
    QThread, pyqtSignal, QByteArray, QRectF, QAbstractAnimation
)

start_application_func = None
APP_DATA_PATH = os.path.join(os.getenv('APPDATA'), "MIMM")
CONFIG_PATH = os.path.join(APP_DATA_PATH, "config.json")

def load_splash_config():
    if not os.path.exists(CONFIG_PATH): return {}
    try:
        with open(CONFIG_PATH, 'r', encoding='utf-8') as f: return json.load(f)
    except (json.JSONDecodeError, IOError): return {}

class LoadingThread(QThread):
    importFinished = pyqtSignal()
    def run(self):
        global start_application_func
        try:
            from main import start_application
            start_application_func = start_application
        except ImportError:
            pass
        self.importFinished.emit()

class AnimatedIconWidget(QWidget):
    def __init__(self, color_pixmap: QPixmap, parent=None):
        super().__init__(parent)
        self.color_pixmap = color_pixmap
        source_image = self.color_pixmap.toImage().convertToFormat(QImage.Format.Format_ARGB32)
        grayscale_image = QImage(source_image.size(), QImage.Format.Format_ARGB32)
        grayscale_image.fill(Qt.GlobalColor.transparent)
        painter = QPainter(grayscale_image)
        for x in range(source_image.width()):
            for y in range(source_image.height()):
                pixel_color = source_image.pixelColor(x, y)
                gray_value = qGray(pixel_color.rgb())
                alpha_value = pixel_color.alpha()
                new_grayscale_color = QColor(gray_value, gray_value, gray_value, alpha_value)
                painter.setPen(new_grayscale_color)
                painter.drawPoint(x, y)
        painter.end()
        self.grayscale_pixmap = QPixmap.fromImage(grayscale_image)

        self.setFixedSize(int(self.color_pixmap.width() * 1.2), int(self.color_pixmap.height() * 1.2))

        self._progress = 0.0
        self._scale = 1.0
        self._wave_phase = 0.0
        self._wave_agitation = 0.0
        self._last_progress_anim_value = 0.0
        self._setup_animations()

    def _setup_animations(self):
        self.wave_animation = QPropertyAnimation(self, b"wave_phase")
        self.wave_animation.setDuration(1200)
        self.wave_animation.setStartValue(0.0)
        self.wave_animation.setEndValue(2 * math.pi)
        self.wave_animation.setLoopCount(-1)
        scale_anim_grow = QPropertyAnimation(self, b"scale")
        scale_anim_grow.setDuration(1200)
        scale_anim_grow.setStartValue(1.0)
        scale_anim_grow.setEndValue(1.05)
        scale_anim_grow.setEasingCurve(QEasingCurve.Type.InOutSine)
        scale_anim_shrink = QPropertyAnimation(self, b"scale")
        scale_anim_shrink.setDuration(1200)
        scale_anim_shrink.setStartValue(1.05)
        scale_anim_shrink.setEndValue(1.0)
        scale_anim_shrink.setEasingCurve(QEasingCurve.Type.InOutSine)
        self.scale_pulse_group = QSequentialAnimationGroup(self)
        self.scale_pulse_group.addAnimation(scale_anim_grow)
        self.scale_pulse_group.addAnimation(scale_anim_shrink)
        self.scale_pulse_group.setLoopCount(-1)
        agitation_up = QPropertyAnimation(self, b"wave_agitation")
        agitation_up.setDuration(800)
        agitation_up.setStartValue(1.5)
        agitation_up.setEndValue(3.5)
        agitation_up.setEasingCurve(QEasingCurve.Type.InOutSine)
        agitation_down = QPropertyAnimation(self, b"wave_agitation")
        agitation_down.setDuration(1000)
        agitation_down.setStartValue(3.5)
        agitation_down.setEndValue(1.5)
        agitation_down.setEasingCurve(QEasingCurve.Type.InOutSine)
        self.agitation_pulse_group = QSequentialAnimationGroup(self)
        self.agitation_pulse_group.addAnimation(agitation_up)
        self.agitation_pulse_group.addAnimation(agitation_down)
        self.agitation_pulse_group.setLoopCount(-1)
        self.progress_settle_group = QSequentialAnimationGroup(self)

    def start_loop_animations(self):
        self.wave_animation.start()
        self.scale_pulse_group.start()
        self.agitation_pulse_group.start()

    def animate_progress_to(self, end_value: float, duration: int, easing: QEasingCurve.Type, overshoot: float = 0.04):
        if self.progress_settle_group.state() == QAbstractAnimation.State.Running:
            self.progress_settle_group.stop()

        self.progress_settle_group.clear()

        start_value = self.getProgress()
        self._last_progress_anim_value = start_value

        progress_anim = QPropertyAnimation(self, b"progress")
        progress_anim.setDuration(int(duration * 0.9))
        progress_anim.setStartValue(start_value)
        progress_anim.setEndValue(end_value + overshoot)
        progress_anim.setEasingCurve(easing)
        progress_anim.valueChanged.connect(self._add_agitation_on_fill)
        self.progress_settle_group.addAnimation(progress_anim)

        if overshoot > 0:
            settle_anim = QPropertyAnimation(self, b"progress")
            settle_anim.setDuration(int(duration * 0.3))
            settle_anim.setStartValue(end_value + overshoot)
            settle_anim.setEndValue(end_value)
            settle_anim.setEasingCurve(QEasingCurve.Type.OutQuad)
            self.progress_settle_group.addAnimation(settle_anim)

        self.progress_settle_group.start()

    def _add_agitation_on_fill(self, current_progress_value: float):
        progress_delta = abs(current_progress_value - self._last_progress_anim_value)
        self._last_progress_anim_value = current_progress_value
        dynamic_agitation = min(15.0, progress_delta * 400) 
        current_base_agitation = self.getWaveAgitation()
        self.setWaveAgitation(current_base_agitation + dynamic_agitation)


    def getProgress(self) -> float:
        return self._progress

    def setProgress(self, value: float):
        self._progress = max(0.0, min(1.0, value))
        self.update()
    progress = pyqtProperty(float, fget=getProgress, fset=setProgress)

    def getScale(self) -> float: return self._scale
    def setScale(self, scale: float): self._scale = scale; self.update()
    scale = pyqtProperty(float, fget=getScale, fset=setScale)
    def getWavePhase(self) -> float: return self._wave_phase
    def setWavePhase(self, phase: float): self._wave_phase = phase; self.update()
    wave_phase = pyqtProperty(float, fget=getWavePhase, fset=setWavePhase)
    def getWaveAgitation(self) -> float: return self._wave_agitation
    def setWaveAgitation(self, agitation: float): self._wave_agitation = agitation; self.update()
    wave_agitation = pyqtProperty(float, fget=getWaveAgitation, fset=setWaveAgitation)

    def paintEvent(self, event):
        painter = QPainter(self)
        painter.setRenderHint(QPainter.RenderHint.Antialiasing)
        painter.setRenderHint(QPainter.RenderHint.SmoothPixmapTransform)
        widget_rect = self.rect()
        scaled_width = self.color_pixmap.width() * self._scale
        scaled_height = self.color_pixmap.height() * self._scale
        x_offset = (widget_rect.width() - scaled_width) / 2
        y_offset = (widget_rect.height() - scaled_height) / 2
        target_draw_rect = QRectF(x_offset, y_offset, scaled_width, scaled_height)
        painter.save()
        painter.setOpacity(0.50)
        painter.drawPixmap(target_draw_rect, self.grayscale_pixmap, QRectF(self.grayscale_pixmap.rect()))
        painter.restore()

        if self._progress > 0.001:
            painter.save()
            clip_path = QPainterPath()
            wave_y_base = target_draw_rect.bottom() - (target_draw_rect.height() * self._progress)
            
            amplitude = self._wave_agitation * (1 - self._progress * 0.5) 
            frequency = 2.5
            clip_path.moveTo(target_draw_rect.left() - 1, target_draw_rect.bottom() + 1)
            clip_path.lineTo(target_draw_rect.left() - 1, wave_y_base)
            for x in range(int(target_draw_rect.left()), int(target_draw_rect.right()) + 2):
                y_wave = wave_y_base
                y_wave += amplitude * math.sin((x / scaled_width) * frequency * 2 * math.pi + self._wave_phase)
                y_wave += (amplitude * 0.3) * math.sin((x / scaled_width) * frequency * 3.5 * math.pi + self._wave_phase * 2.2)
                y_wave += (amplitude * 0.15) * math.sin((x / scaled_width) * frequency * 8.0 * math.pi + self._wave_phase * 1.5)
                clip_path.lineTo(x, y_wave)
            clip_path.lineTo(target_draw_rect.right() + 1, target_draw_rect.bottom() + 1)
            clip_path.closeSubpath()
            painter.setClipPath(clip_path)
            painter.drawPixmap(target_draw_rect, self.color_pixmap, QRectF(self.color_pixmap.rect()))
            painter.restore()

class AdvancedSplashScreen(QWidget):
    def __init__(self):
        super().__init__()
        self.main_window = None
        self.instance_manager = None
        self.setWindowFlags(Qt.WindowType.SplashScreen | Qt.WindowType.FramelessWindowHint | Qt.WindowType.WindowStaysOnTopHint)
        self.setAttribute(Qt.WidgetAttribute.WA_TranslucentBackground)

        self.import_is_finished = False
        self.animation_is_finished = False

        pixmap = QPixmap()
        image_loaded = False
        if 'APP_ICON_BASE64' in globals() and 'APP_ICON_BASE64' in globals() and globals()['APP_ICON_BASE64']:
            try:
                image_data = base64.b64decode(globals()['APP_ICON_BASE64'])
                pixmap.loadFromData(image_data)
                image_loaded = True
            except Exception: pass
        if not image_loaded and os.path.exists("app_icon.png"):
            if pixmap.load("app_icon.png"): image_loaded = True
        if image_loaded:
            pixmap = pixmap.scaled(220, 220, Qt.AspectRatioMode.KeepAspectRatio, Qt.TransformationMode.SmoothTransformation)
        else:
            pixmap = QPixmap(220, 220); pixmap.fill(QColor("#cc3333"))

        self.icon_widget = AnimatedIconWidget(pixmap)
        layout = QVBoxLayout(self)
        layout.addWidget(self.icon_widget, alignment=Qt.AlignmentFlag.AlignCenter)
        self.setFixedSize(300, 300)
        self.move(QApplication.primaryScreen().geometry().center() - self.rect().center())
        
        self._setup_animations()

    def _setup_animations(self):
        self.fade_in_anim = QPropertyAnimation(self, b"windowOpacity")
        self.fade_in_anim.setDuration(500)
        self.fade_in_anim.setStartValue(0.0)
        self.fade_in_anim.setEndValue(1.0)
        self.fade_in_anim.setEasingCurve(QEasingCurve.Type.OutQuad)

        self.fade_out_anim = QPropertyAnimation(self, b"windowOpacity")
        self.fade_out_anim.setDuration(400)
        self.fade_out_anim.setStartValue(1.0)
        self.fade_out_anim.setEndValue(0.0)
        self.fade_out_anim.setEasingCurve(QEasingCurve.Type.InQuad)
        self.fade_out_anim.finished.connect(self._show_main_window_and_close)

    def start_animations_and_load(self):
        self.show()
        self.fade_in_anim.start()
        self.icon_widget.start_loop_animations()
        self.start_app_loading()

    def start_app_loading(self):
        self.icon_widget.progress_settle_group.finished.connect(self.on_animation_finished)
        
        self.icon_widget.animate_progress_to(
            end_value=0.9,
            duration=1000,
            easing=QEasingCurve.Type.InOutSine,
            overshoot=0.0
        )
        self.loading_thread = LoadingThread()
        self.loading_thread.importFinished.connect(self.on_import_finished)
        self.loading_thread.start()

    def on_import_finished(self):
        QApplication.processEvents()
        if start_application_func:
            self.main_window, self.instance_manager = start_application_func()
            if self.instance_manager:
                QApplication.instance().aboutToQuit.connect(self.instance_manager.release)
        
        self.import_is_finished = True
        self._try_to_finish()

    def on_animation_finished(self):
        try:
            self.icon_widget.progress_settle_group.finished.disconnect(self.on_animation_finished)
        except TypeError:
            pass
        self.animation_is_finished = True
        self._try_to_finish()

    def _try_to_finish(self):
        if self.import_is_finished and self.animation_is_finished:
            self.finish_loading_animation()

    def finish_loading_animation(self):
        if not self.main_window:
            QApplication.instance().quit()
            return

        self.icon_widget.animate_progress_to(
            end_value=1.0,
            duration=800,
            easing=QEasingCurve.Type.OutQuad,
            overshoot=0.05
        )
        self.icon_widget.progress_settle_group.finished.connect(self.start_fade_out)

    def start_fade_out(self):
        try:
            self.icon_widget.progress_settle_group.finished.disconnect(self.start_fade_out)
        except TypeError:
            pass
        self.fade_out_anim.start()

    def _show_main_window_and_close(self):
        if self.main_window:
            QApplication.setOverrideCursor(Qt.CursorShape.WaitCursor)
            try:
                if hasattr(self.main_window, 'initialize_application'):
                    self.main_window.initialize_application()
            finally:
                QApplication.restoreOverrideCursor()

            config = getattr(self.main_window, 'config', {})
            if "window_geometry" in config:
                try: self.main_window.restoreGeometry(QByteArray.fromBase64(config['window_geometry'].encode('utf-8')))
                except Exception: pass
            if not config.get("start_minimized", False):
                if config.get("window_maximized", False): self.main_window.showMaximized()
                else: self.main_window.show()
        self.close()

if __name__ == '__main__':
    app = QApplication(sys.argv)
    splash = AdvancedSplashScreen()
    splash.start_animations_and_load()
    sys.exit(app.exec())